// Container onde os serviços serão exibidos
const container = document.getElementById("services-container");

// Função para renderizar os serviços
function renderServices(filteredServices) {
  if (!container) return;
  
  container.innerHTML = "";
  filteredServices.forEach(service => {
    const card = document.createElement("div");
    card.classList.add("service-card");

    card.innerHTML = `
      <img src="${service.imagem}" alt="${service.nome}" class="service-img">
      <h3>${service.nome}</h3>
      <p>${service.descricao}</p>
      <p><strong>Categoria:</strong> ${service.categoria}</p>
      <p class="price">${service.preco}</p>
    `;

    container.appendChild(card);
  });
}

// Variáveis globais para filtros
let currentCategory = "Todos";
let currentSearchTerm = "";

// Função para aplicar todos os filtros
function applyFilters() {
  let filteredServices = services;

  // Filtrar por categoria
  if (currentCategory !== "Todos") {
    filteredServices = filteredServices.filter(service => service.categoria === currentCategory);
  }

  // Filtrar por termo de busca
  if (currentSearchTerm.trim() !== "") {
    filteredServices = filteredServices.filter(service =>
      service.nome.toLowerCase().includes(currentSearchTerm.toLowerCase()) ||
      service.descricao.toLowerCase().includes(currentSearchTerm.toLowerCase())
    );
  }

  renderServices(filteredServices);
}

// Aguarda o DOM estar completamente carregado
document.addEventListener('DOMContentLoaded', function() {
  // Renderiza todos ao carregar a página
  renderServices(services);

  // Filtro por categoria
  const filterButtons = document.querySelectorAll(".filter-btn");
  const searchInput = document.getElementById("search-input");

  filterButtons.forEach(button => {
    button.addEventListener("click", () => {
      filterButtons.forEach(btn => btn.classList.remove("active"));
      button.classList.add("active");

      currentCategory = button.getAttribute("data-category");
      applyFilters();
    });
  });

  // Busca por nome
  if (searchInput) {
    searchInput.addEventListener("input", (e) => {
      currentSearchTerm = e.target.value;
      applyFilters();
    });

    // Limpar busca com Escape
    searchInput.addEventListener("keydown", (e) => {
      if (e.key === "Escape") {
        e.target.value = "";
        currentSearchTerm = "";
        applyFilters();
      }
    });
  }
});
